INSERT INTO `ticket_responses` VALUES (1,'You\'re welcome, thank you for using ArmorerLink!',2,'2023-08-11 21:34:30','2023-08-18 23:18:58',NULL),(2,'We\'re sorry, your training request date and time is taken, please request another date and time. Thank you.',4,'2023-08-11 21:34:38','2023-08-18 23:20:07',NULL),(3,'We are glad to help you with this issue. Kindly submit a training request. Thank you.',5,'2023-08-11 21:34:45','2023-08-18 23:21:41',NULL),(4,'Please follow this video tutorial link for resolution instructions.',6,'2023-08-11 21:34:52','2023-08-18 23:22:03',NULL),(5,'Please provide the firearm make, model, serial number and officer number.',7,'2023-08-11 21:34:58','2023-08-18 23:22:18',NULL),(6,'We need additional information to assist you. Please provide the equipment make, model, serial number and officer number.',8,'2023-08-11 21:35:05','2023-08-18 23:21:05',NULL),(7,'Your training request is confirmed,  a meeting link will be sent shortly. We are looking forward to training with you and your team!',3,'2023-08-11 21:40:33','2023-08-18 23:19:47',NULL),(8,'Received,  thank you.',1,'2023-08-11 21:45:57','2023-09-06 17:59:02',NULL),(9,'Issue resolved. Thank you for using ArmorerLink.',9,'2023-08-11 21:48:34','2023-08-18 23:22:38',NULL),(10,'Thank you for taking the time to provide us with a suggestion. We will pass along your suggestion to our development team , and they will add it to the customer suggestion list.',10,'2023-08-18 22:14:04','2023-08-18 23:22:59',NULL);
